The parser for the Lisp dialect is a simple recursive function. It takes a vector of tokens (in reverse) generated by the lexer and generates a single List Object representing the entire Lisp program. The core logic of the parser is implemented by the recursive parse_list function as shown below. It expects a vector of tokens, with the first token of the vector being a left parenthesis indicating the start of the list. The function then proceeds to process the elements of the list one at a time. If it encounters atomic tokens such as an integer or symbol it creates corresponding atomic objects and adds them to the list. If it encounters another left parenthesis it recurses with the remaining tokens. Finally, the function returns with the list object when it encounters the right parenthesis. let token = tokens.pop();
if token != Some(Token::LParen) { return Err(ParseError { err: format!("Expected LParen, found {:?}", token), });
} let mut list: Vec<Object> = Vec::new(); while !tokens.is_empty() { let token = tokens.pop(); if token == None { return Err(ParseError { err: format!("Insufficient tokens"), }); } let t = token.unwrap(); match t { Token::Integer(n) => list.push(Object::Integer(n)), Token::Symbol(s) => list.push(Object::Symbol(s)), Token::LParen => { tokens.push(Token::LParen); let sub_list = parse_list(tokens)?; list.push(sub_list); } Token::RParen => { return Ok(Object::List(list)); } }
}

